import React from 'react';
import ReactDOM from 'react-dom';
import companyLogo from './logo512.png';
import logo from './logo.svg';
import './App.css';


function Nav() {
  return (
    <nav>
      <img className="logo" src={companyLogo} alt="Geekery Logo" />
      <ul>
        <li>Schedule</li>
        <li>Team</li>
        <li>About</li>
      </ul>
    </nav>
  );
}

export default Nav;
